"use strict";

function f_gold(s) {
    let ans = [];
    let n = s.length;
    let dp = Array.from(Array(n), () => Array(n).fill(true));
    for (let i = n - 1; i >= 0; i--) {
        for (let j = i + 1; j < n; j++) {
            dp[i][j] = s[i] === s[j] && dp[i + 1][j - 1];
        }
    }
    function dfs(s, i, t) {
        if (i === n) {
            ans.push([...t]);
            return;
        }
        for (let j = i; j < n; j++) {
            if (dp[i][j]) {
                t.push(s.slice(i, j + 1));
                dfs(s, j + 1, t);
                t.pop();
            }
        }
    }
    dfs(s, 0, []);
    return ans;
}
